import React, { useState, useEffect } from 'react';
import axios from 'axios';
import ResolvedTodos from './ResolvedTodos';
import UnresolvedTodos from './UnresolvedTodos';

const TodoList = () => {
  const [todos, setTodos] = useState([]);

  useEffect(() => {
    axios.get('http://jsonplaceholder.typicode.com/todos')
      .then(response => {
        setTodos(response.data);
      })
      .catch(error => {
        console.error('Error fetching todos:', error);
      });
  }, []);

  const unresolvedTodos = todos.filter(todo => !todo.completed);
  const resolvedTodos = todos.filter(todo => todo.completed);

  return (
    <div>
      <ResolvedTodos todos={resolvedTodos} />
      <UnresolvedTodos todos={unresolvedTodos} />
    </div>
  );
};

export default TodoList;
